  console.log(props.page);
  const checkPage = (props) => {
    if (props.page === "route") {
      return (
        <div>
          <TripDisplayItem />
        </div>
      );
    }
  };
  // if (isLoggedIn) {
  //   return <UserGreeting />;
  // }
  // return <GuestGreeting />;

  return (
    <main className="planning">
      <Sidebar></Sidebar>
      <h1>asdf</h1>
      {checkPage(props)}
      {props.page === "meal" && <h1>this is meals</h1>}
      {props.page === "route" && <h1>this is route</h1>}
    </main>
  );
};

export default Planning;
